[enrich][jira] Add projects support to JIRA.

Use the format:

    "client-gui": {
        "jira": [
            "https://jira.open-o.org/projects/CLIENT"
        ]
    }

[elastic_items] Remove empty intial filter because ES 6.x does not support it

This query which works with ES < 6.x does not work anymore:

{
    "query": {
        "bool": {
            "must": [
                {},
                {
                    "terms": {
                        "author_uuid": [
                            "5d9fea1ff2d686c25497d2b8010e6f9ddbb8f2a4",
                            "dae602936b2ccd72b8a62b7a428a2b94e7042d84"
                        ]
                    }
                }
            ]
        }
    }
}

The inicial empty term "{}," must be removed.

[enrich] Add extra study

This code provides a new study that enables setting/removing
extra fields on/from a target index. For example if a use case
requires tagging specific documents in an index with extra
fields, like tagging all kernel maintainers with an extra
attribute such as "maintainer = True".

The extra data to be added/removed is passed via a JSON (`json_url`)
and contains:
- a list of AND `conditions`, which must be all True to select a
  document. Each condition is defined by a `field` present in
  the document and a `value`.
- an optional `date_range`, used to apply the conditions on a
  time span. Date range is defined by a datetime `field`, a
  `start` and optional an `end` date.
- a list of `set_extra_fields`, which will be set (i.e., added
  or modified) on the target index. An `add_extra_field` is defined
  by a `field` and its `value`. Field names are automatically prepended
  with the word `extra`. This is needed to separate the original
  fields with the extra ones.
- a list of `remove_extra_fields`, which will be removed from the
  target index if exist. A `remove_extra_field` is defined by a
  `field`, which automatically prepended with the word `extra`. This is
  needed to avoid deleting original fields. Note that removals are
  executed after additions.

An example of json is provided below
```
        [
            {
                "conditions": [
                    {
                        "field": "author_name",
                        "value": "Mister X"
                    }
                ],
                "set_extra_fields": [
                    {
                        "field": "maintainer",
                        "value": "true"
                    }
                ]
            },
            {
                "conditions": [
                    {
                        "field": "author_name",
                        "value": "Mister X"
                    }
                 ],
                 "date_range": {
                    "field": "grimoire_creation_date",
                    "start": "2018-01-01",
                    "end": "2019-01-01"
                },
                "remove_extra_fields": [
                    {
                        "field": "maintainer",
                        "value": "true"
                    }
                ]
            }
        ]
```

